        complex<double> f17ctQb(const CharmLoopsParameters & clp)
        {
            const double muhat = clp.muhat;
            const complex<double> yb = clp.y_b;

            const complex<double> result = - 8.0 + 4.0 * (std::log(1.0 + yb) - std::log(1.0 - yb)) / yb - 8.0 * std::log(muhat);

            return result / 81.0;
        }

